import React, { useState } from "react";
import LoginRegister from "../LoginRegister/LoginRegister";
import Navigation from "../Home/Navigation";
import Decoration from "../../assets/Decoration.svg";
import { Link } from "react-router-dom";

export default function Register() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [password2, setPassword2] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <section className="login">
      <div className="login-register-nav">
        <LoginRegister />
        <Navigation />
      </div>
      

      <form className="login-register-form" onSubmit={handleSubmit}>
        <h2 className="form-title">Załóż konto</h2>
        <img className="decoration" src={Decoration} alt="decoration" />

        <div className="form-inputs">
          <div className="inputs-Email inputs">
            <label htmlFor="email" className="email-label">Email</label>
            <input
              type="text"
              id="email"
              name="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>

          <div className="inputs-password inputs">
            <label htmlFor="password" className="">Hasło</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>

          <div className="inputs-password-two inputs">
            <label htmlFor="password2">Powtórz hasło</label>
            <input
              type="password"
              id="password2"
              value={password2}
              onChange={(e) => setPassword2(e.target.value)}
            />
          </div>
        </div>

        <Link to="/rejestracja">
          <button className="btn">Zaloz konto</button>
        </Link>
        <button className="btn" type="submit">
          Zaloguj sie
        </button>
      </form>
    </section>
  );
}
